import User from "./User";

class App extends React.Component {

	render() {

		return(
			<div className="appContainer">
			<div
			className={
			this.state.isBusy ? "current-status busy" : "current-status open"
			}
			>
			<div>
			<h1 id="currentStatus">{this.state.isBusy ? "BUSY" : "OPEN"}</h1>
