			</div>
			</div>

				<Router className="appContainer">
				<div>
				<Route path={"/"} component={Root} />
				<Route path={"/"} component={Home} />
				<Route path={"/feature"} component={Feature} />
				<Route path={"/ticket"} component={Ticket} />
				<Route path={"/user"} component={User} />
				</div>
				</Router>

				</div>
		      );

	}
}

export default App;
